        firstName: "",
        lastName: "",
        email: "",
        password: ""
     }

    handleOnChange = (event) => {
        const {name, value} = event.target;
        this.setState({
            [name]: value        
        })
    }

   handleSubmit = (event) => {
       event.preventDefault();
    api.createUser()
   }

    render() {
        return (
            <div>
                <Register />
            </div>
        )
    }

}
